import React from "react";
import { SafeAreaView, StyleSheet, Text, TouchableOpacity, View,Image, TextInput } from "react-native";

import { useNavigation } from "@react-navigation/native";






export default function Cadastro() {
    const navigation = useNavigation()

    return (
        <SafeAreaView style={styles.container}>
          <Image style={styles.Image} source={require("../../../assets/fotocapa.jpg")} />
            
            <TextInput style={styles.input} placeholder="NOME"/>
            <TextInput style={styles.input1} placeholder="E-mail"/>
            <TextInput style={styles.input1} placeholder="Senha"/>
            <TextInput style={styles.input1} placeholder="Confirmar senha"/>
            <TouchableOpacity onPress={() => navigation.navigate("Testo")}>
                <Text sty>Mudar</Text>
            </TouchableOpacity>
        </SafeAreaView>

    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
    },
    Image: {
        fontSize: 30,
        marginStart: 30,
     },
     input:{
        fontSize:25,
        borderWidth: 1,
        marginTop:90,
        padding:7.5,
        marginBottom:10,
        textAlign:"center",
        backgroundColor:"#AFFF8B"
     },
     input1:{
        fontSize:25,
        borderWidth: 1,
        marginTop:10,
        padding:7.5,
        marginBottom:10,
        textAlign:"center",
        backgroundColor:"#AFFF8B"
     },
})
